are I choose to go the high level path and use `}<inlineCode parentName="p">{`ml5.js`}</inlineCode></p>
    <p>{`So heading over to the `}<a parentName="p" {...{
        "href": "https://learn.ml5js.org/docs/#/"
      }}>{`ml5.js`}</a>{` site they
suggest watching Dan Shiffmans videos on introduction to ml5.js which after
looking around a big on his playlists lead to
`}<a parentName="p" {...{
        "href": "https://www.youtube.com/playlist?list=PLRqwX-V7Uu6YPSwT06y_AEYTqIwbeam3y"
      }}>{`this`}</a>{`.
`}<em parentName="p">{`Turns out YouTube has all our answers.`}</em></p>
    <p>{`So theres quite of few libraries/packages that are going to be used `}</p>
    <ul>
      <li parentName="ul"><inlineCode parentName="li">{`TensorFlow`}</inlineCode>{` - Which is made by Google and usualy used in Python which is
basicly running C++.`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`TensorFlow.js`}</inlineCode>{` is also made by Google and does everything in JavaScript.`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`ml5.js`}</inlineCode>{` is written on top of `}<inlineCode parentName="li">{`TensorFlow.js`}</inlineCode>{`. `}<inlineCode parentName="li">{`TensorFlow.js`}</inlineCode>{` is a low level
lib where as `}<inlineCode parentName="li">{`ml5.js`}</inlineCode>{` abstracts that out a bit so you dont have to worry about
stuff like memory management(like points in C++ vs Java).`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`P5.js`}</inlineCode>{` - A weird library ment for the creative people to make coding easier.
It has some drawing functions and some calculation functions. It basically
treats the entire webpage as a drawing pad.`}</li>
    </ul>
    <p>{`So that will be it for now, I still need to figure out how I am going to
structure the repo and the doc site!`}</p>
